import { useState } from 'react';

export default function CreateProduct() {
  const [name, setName] = useState('Chris');
  const [price, setPrice] = useState('0');
  return (
    <form>
      <label htmlFor="name">
        Name
        <input
          type="text"
          id="name"
          name="name "
          placeholder="Name"
          value={name}
          onChange={(e) => setName(e.target.value)}
        />
      </label>
      <label htmlFor="price">
        price
        <input
          type="text"
          id="price"
          name="price "
          placeholder="Price"
          value={price}
          onChange={(e) => setPrice(e.target.value)}
        />
      </label>
    </form>
  );
}
